import React from 'react';
import Case from './Case';


function Raw(props) {
  return (
    <div className={"raw"+props.aorb}>
    <Case aorb={props.aorb} bg="#ffffff"></Case>
    <Case aorb={props.aorb} bg="#ffffff"></Case>
    <Case aorb={props.aorb} bg="#ffffff"></Case>
    <Case aorb={props.aorb} bg="#ffffff"></Case>
    </div>
  );
}

export default Raw;
